import React from 'react';


const getTrailer = ({trailer_key}) => {
    return (
        <iframe 
        src={`https://www.youtube.com/embed/${trailer_key}`}
        width= "860"
        height= "515"
        frameborder= "0"
        allowFullscreen= "true"
        >

        </iframe>
    );
};

export default getTrailer;
